import React from 'react';
import './App.css';
import { render } from '@testing-library/react';

class App extends React.Component{
constructor(){
  super()
  this.state={
    name: "",
    email : "",
    pswd : "",
    cpswd : ""
  }
}

updateName=(x)=>{
  this.setState({
    name : x.target.value 
  })
}
  updateEmail=(x)=>{
    this.setState({
      email : x.target.value
    })
  }
  updatePswd=(x)=>{
    this.setState({
      pswd : x.target.value
    })
  }
  updateCpswd=(x)=>{
    this.setState({
      cpswd : x.target.value
    })
  }

check =()=>{
  if(this.state.name < 5){
    alert("Name should be atleast 6 character")
  }
  else if (this.state.pswd != this.state.cpswd){
    alert("Password dosen't match")
  }
  else if ((this.state.name ="") || (this.state.email = "" ) || (this.state.pswd ="") || (this.state.cpswd = "")){
    alert("Every Information is required")
  }
  else {
    alert("Register Successfully")
  }
}


  render(){
  return (
    <div className="App">
    <form>
      <label>Name : </label>
      <input type='text' value={this.state.name} onChange={this.updateName}></input>
      <br/><br/>
      <label>Email : </label>
      <input type='emial' value={this.state.email }onChange={this.updateEmail}></input>
      <br/><br/>
      <label>Password : </label>
      <input type='password'value={this.state.pswd} onChange={this.updatePswd}></input>
      <br/><br/>
      <label>Confrom Password : </label>
      <input type='password' value={this.state.cpswd} onChange={this.updateCpswd}></input>
      <br/><br/>
      <input type='submit' value='Regiser'></input>
    </form>
    </div>
  );
  }
}

export default App;
